function cycloocfls(a::AbstractVector)
    println("Julia port of CUTEST's CYCLOOCFLS")
    P=10000
    x=zeros(P)
    y=zeros(P)
    z=zeros(P)
    a[1]=y[2]
    a[2]=z[2]
    x=a[3:P]
    y=a[(P+1):(2*P-2)]
    y=a[(2*P+1-2):(length(a))]
    M=-2*(P)/(2*(P)-2)
    term1 = -1+y[2]^2+z[2]^2
    term2 = M+x[3]^2+y[3]^2+z[3]^2
    term3 = -1+x[3]^2+(y[2]-y[3])^2+(z[2]-z[3])^2
    term4 = M+x[4]^2+(y[2]-y[4])^2+(z[2]-z[4])^2
    term5 = -1+x[length(x)]^2+y[length(x)]^2+z[length(x)]^2
    term6 = M+x[length(x)-1]^2+y[length(x)-1]^2+z[length(x)-1]^2
    term7 = M+x[length(x)]^2+(y[length(x)]-y[2])^2+(z[length(x)]-z[2])^2
    term8 = -1+(x[length(x)-1]-x[length(x)])^2+(y[length(x)-1]-y[length(x)])^2+(z[length(x)-1]-z[length(x)])^2
    sum=term1+term2+term3+term4+term5+term6+term7+term8
    for i = 3:(length(x)-2)
        termA = -1+(x[i]-x[i+1])^2+(y[i]-y[i+1])^2+(z[i]-z[i+1])^2
        termB = M+(x[i]-x[i+2])^2+(y[i]-y[i+2])^2+(z[i]-z[i+2])^2
        sum = sum+termA+termB
    end
    return sum
end

function spin2ls(a::AbstractVector)
