    sum=0
    N=50
    x=zeros(N)
    y=zeros(N)
    a[1]=mu
    a[2]=omega
    x=a[3:(3+N)]
    y=a[(3+N+1):length(a)]
    for i = 3:(length(x)-2)
        term1 = -mu*x[i]
        term2 = om*y[i]
        term3 = -mu*y[i]
        term4 = om*x[i]
        sum1 = term1+term2
        sum2 = term3+term4
        for j = 1:(i-1)
            termA = (y[i]-y[j])/((y[i]-y[j])^2+(x[i]-x[j])^2)
            sum1 = sum1 + termA
            termB = (x[i]-x[j])/((y[i]-y[j])^2+(x[i]-x[j])^2)
            sum2 = sum2 + termB
        end
        for j = (I+1):length(x)
