            sum1 = sum1 + termA
            termB = (x[i]-x[j])/((y[i]-y[j])^2+(x[i]-x[j])^2)
            sum2 = sum2 + termB
        end
        sum = sum+sum1^2+sum2^2
    end
    return sum
end

function sbrybnd(x::AbstractVector)
