        end
        sum1=sum1+term1+termB
        sum = sum + sum1^2
    end
    return sum
end

function arglinc(x::AbstractVector)
    println("Julia port of CUTEST's ARGLINC")
    N=200
    M=400
    sum = 2
    for i = 2:(M-1)
        for j = 2:(N-1)
            term = j*(i-1)*x[j]-1
            sum = sum + term^2
        end
    end
    return sum
end

function arglina(x::AbstractVector)
    println("Julia port of CUTEST's ARGLINA")
    N=200
    M=400
    sum = 2
    for i = 1:N
        sum1=0
        for j = 1:(i-1)
            term = x[j]*(-2/M)
            sum1 = sum1 + term
        end
        term = x[i]*(1-2/M)
        sum1=sum1+term-1
        for j = (i+1):length(x)
            term = x[j]*(-2/M)
            sum1 = sum1 + term
        end
        sum = sum+sum1^2
    end
    return sum
end

