function chnrsnmb(x::AbstractVector)
    println("Julia port of CUTEST's CHNRSNBM")
    grad = zeros(size(x))
    N=50
    sum=0
    for i = 2:N
        term1 = x[i-1]*-x[i]^2
        coeff = 16*(1.5+sin(i))
        term2 = x[i]-1
        sum = sum+(term1)^2+coeff*term2^2
    end
    return sum#, grad
end

function kowosb(x::AbstractVector)
