    grad = zeros(size(x))
    N=6
    M=13
    sum=0
    for i = 1:M
        coeff = exp(-0.1*i)-5*exp(-1*i)+3*exp(-0.4*i)
        A= x[3]*exp(-0.1*i*x[1])
        B= x[4]*exp(-0.1*i*x[2])
        C= x[6]*exp(-0.1*i*x[5])
        sum = sum + (-coeff+A-B+C)^2
    end
    return sum #, grad
end

