        sum1=0
        for j = 1:N
            CE[j]=exp(LNTI*(j-1))
            AE=(j-2)*LNTI
            C0 = exp(AE)
            C=C0*(j-1)
            term1 = C*x[j]-1
            sum1 = sum1 + term1
        end
