end

function fminsurf(x::AbstractVector)
    println("Julia port of CUTEST's FMINSURF")
    grad = zeros(size(x))
    P=75
    SLOPEJ=4
    SLOPEI=8
    MID=P/2
    SCALE=1/(1/(P-1))^2
    PARAM=0.5*(P-1)^2
    sum=0
    for i = 1:(P-1)
        sum1=0
        for j = 1:(P-1)
            term1 = 1
            term2 = PARAM*(x[i,j]-x[i+1,j+1])^2
            term3 = PARAM*(x[i+1,j]-x[i,j+1])^2
            sum1=sum1+(1/SCALE)*sqrt(term1+term2+term3)
        end
    end
    sum2=0
    for j=1:P
        for i=1:P
            sum2=sum2+x[i,j]
        end
    end
    sum2 = (1/P^4)*sum2
    sum=sum+sum2^2
    return sum #, grad
end

function penalty2(x::AbstractVector)
    println("Julia port of CUTEST's PENALTY2")
    grad = zeros(size(x))
    N=200
    A=10^(-5)
    B=0.1
    M=2*N
    term1 = x[1]-0.2
    sum=B*term1^2
    for i = 2:(N)
        coeff = exp(0.1*(i-1))+exp(0.1*i)
        term1 = -coeff+exp(0.1*x[i])+exp(0.1*x[i-1])
        sum=sum+A*term1^2
    end
    for i = (N+1):(M-1)
        coeff = exp(0.1)
        term1 = -coeff+exp(0.1*x[i-N+1])
        sum=sum+A*term1^2
    end
    term2 = -1
    for i=1:N
        term2=term2+(N-j+1)*x[i]^2
    end
    sum=sum+B*term2^2
    return sum #, grad
end

