function heart6ls(x::AbstractVector)
    println("Julia port of CUTEST's HEART6LS")
    grad = zeros(size(x))
    sum_Mx=-0.816
    sum_My=-0.017
    sum_A=-1.826
    sum_B=-0.754
    sum_C=-4.839
    sum_D=-3.259
