    E12=(sum_My-x)*u*w
    E13=c*(t^2-v^2)
    E14=a*t*v
    E15=(sum_My-c)*(u^2-w^2)
    E16=(sum_Mx-a)*u*w
    E17=a*t*(t^2-3*v^2)
    E18=c*v*(v^2-3*t^2)
    E19=(alph-x)y(y^2-3z^2)
    E20=(sum_My-c)*w*(w^2-3*u^2)
    E21=c*t*(t^2-3*v^2)
    E22=a*v*(v^2-3*t^2)
    E23=(sum_My-c)*u*(u^2-3*w^2)
    E24=(sum_Mx-a)*w*(w^2-3*u^2)
    G1=-sum_A+E1+E2-E3-E4
    G2=-sum_B+E5+E6+E7+E8
    G3=-sum_C+E9-2*E10+E11-2*E12
