    for i =2:(M-1)
        E[i,i] = -(B[i,i]^2+B[i-1,i]*B[i,i-1]+B[i+1,i]*B[i,i+1])
    end
    E[M,M] = -(B[M,M]^2+B[M-1,M]*B[M,M-1])
    for i = 1:(M-1)
        E[i+1,i] = -(B[i+1,i+1]*B[i+1,i]+B[i+1,i]*B[i,i])
    end
    for i = 2:(M)
