function msqrtbls(x::AbstractVector)
    println("Julia port of CUTEST's MSQRTBLS")
    grad = zeros(size(x))
    P=32
    N=P^2
    sum=0
    #CONSTZ
    B =zeros(P,P)
    A=zeros(P,P)
    G=zeros(P,P)
    k=0
    for i =1:P
        for j = 1:P
            k=k+1
            B[i,j] = sin(k^2)
        end
    end
    B[3,1]=0
    for i =1:P
        for j = 1:P
            for k = 1:P
                A[i,j] = B[i,k]*B[k,j]
            end
        end
    end
    for i =1:P
        for j = 1:P
            G[i,j] = -A[i,j]
            for t = 1:P
                G[i,j]=G[i,j]+x[i,t]*x[t,j]
            end
        end
    end
    for i =1:P
        for j = 1:P
            sum = sum+G[i,j]^2
        end
    end
    return sum #, grad
end

function eigenbls(x::AbstractVector)
    println("Julia port of CUTEST's EIGENBLS")
    grad = zeros(size(x))
    N=50
    sum=0
    #CONSTZ
    A=zeros(N,N)
    A[1,1]=2
    E=zeros(N,N)
    O=zeros(N,N)
    for j = 1:N
        for i=1:(j-2)
            A[i,j]=0
        end
        A[j-1,j]=-1
        A[j,j]=2
    end
    for j = 1:N
        O[j,j]=-1
        for i=1:j
            E[i,j]=-A[i,j]
        end
    end
    for j = 1:N
        for i=1:j
            for k=1:N
                E[i,j]=E[i,j]+q[k,i]*q[k,j]*d[k]
                O[i,j]=O[i,j]+q[k,i]*q[k,j]
            end
        end
    end
    for j = 1:N
        for i=1:j=N
            sum=sum+E[i,j]^2+O[i,j]^2
        end
    end
    return sum #, grad
end

