        for i=1:j
            E[i,j]=-A[i,j]
        end
    end
    for j = 1:N
        for i=1:j
            for k=1:N
                E[i,j]=E[i,j]+q[k,i]*q[k,j]*d[k]
                O[i,j]=O[i,j]+q[k,i]*q[k,j]
            end
        end
    end
    for j = 1:N
        for i=1:j=N
            sum=sum+E[i,j]^2+O[i,j]^2
        end
    end
    return sum #, grad
end

function djtl(x::AbstractVector)
    println("Julia port of CUTEST's DJTL")
    grad = zeros(size(x))
    LL=zeros(4)
    SL=zeros(4)
    LU=zeros(4)
    SU=zeros(4)
    E1=(x[1]-10)^3
    E2=(x[2]-20)^3
    E3=(x[1]-5)^2
    E4=(x[2]-5)^2
    E5=(x[1]-6)^2
    OBJ=E1+E2
    CU1=200-E3-E4
    CL1=-100+E3+E4
    CU2=-E3-E4
    CL2=82.81+E4+E5
    BU1=100-x[1]
    BL1=x[1]-13
    BU2=100-x[2]
    BL2=x[2]
    sum=OBJ+10^10*CU1^2+10^10*CL1^2+10^10*CU2^2+10^10*CL2^2+10^10*BU1^2+10^10*BL1^2+10^10*BU2^2+10^10*BL2^2
    return sum #, grad
end

function penalty3(x::AbstractVector)
    println("Julia port of CUTEST's PENALTY3")
    grad = zeros(size(x))
    N=200
    MA=-10^(-3)
    sum=0
    A=-MA
    REXP=0
    SEXP=0
    RS=0
    for i=1:(N-2)
        REXPI = A*((x[i]+2*x[i+1]+10*x[i+2])-1)^2*exp(x[N])
        REXP=REXP+REXPI
        SEXPI=A*((2*x[j]+x[j+1])-3)^2*exp(x[N-1])
        SEXP=SEXP+SEXPI
        for j = 1:(N-2)
            RSIJ = A*((x[i]+2*x[i+1]+10*x[i+2])-1)^2*((2*x[j]+x[j+1])-3)^2
            REXP=REXP+RSIJ
            sum=sum+REXP
        end
        sum=sum+REXPI+SEXPI
    end
    T2=0
    U=0
    for i =1:N
        for j=1:N
            T2=T2+(x[i]^2-N)*(x[j]^2-N)
            sum=sum+T2
        end
    end
    for i =1:(N/2)
        U=U+(x[i]-1)^2
        sum=sum+U
    end
    return sum #, grad
end

function streg(x::AbstractVector)
    println("Julia port of CUTEST's STREG")
    grad = zeros(size(x))
    N=4
    G1=x[2]-x[1]^2
    G2=x[1]-1
    sum=100*G1^2+G2^2+0.5*x[3]^2+0.5*x[4]^2
    return sum #, grad
end

